INSERT INTO `products` (`product_id`, `productName`, `categories`, `price`, `product_Image`, `stock`, `size_M`, `size_L`, `size_XL`, `product_description`, `active`) VALUES
('P00003', 'Youtooz Arcane Heimerdinger Shoulder Rider', 'Plush', 29.99, '6738bc15390ae.png,6738bc15392d3.png,6738bc15394e9.png', 0, NULL, NULL, NULL, 'Whether you stand with Zaun and the undercity, push for progress in Piltover, or just want to watch it all burn, the new Arcane merch collection has something for every fan.\r\n\r\nKeep one of Piltover&#39;s finest minds at your side with the Youtooz Arcane Heimerdinger Shoulder Rider.\r\n\r\nSitting at roughly 6 inches tall and stuffed with 100% PP cotton, the Arcane Heimerdinger Shoulder Rider comes with a magnetic disc to perch atop your shoulder so that this professor can always have your back (and we do mean that literally)!\r\n\r\nMade in partnership with our friends at Youtooz.', 1),
('P00004', 'Teemo Plush', 'Plush', 29.99, '6738bcfe5bc78.png,6738bcfe5bdd7.png,6738bcfe5bf15.png,6738bcfe5c005.png', 0, NULL, NULL, NULL, 'A legend amongst his Yordle brothers and sisters in Bandle City, Teemo scouts the world with boundless enthusiasm and a cheerful spirit - right up until it comes to defending Bandle City in combat.\r\n\r\nNow, you can bring Teemo with you on adventures to places few, if any, Yordles have ventured to before with our Teemo Plush. Scout onward with confidence knowing you&#39;ll always have one of the most capable (and deadly) Yordles at your side!\r\n\r\nApproximate Measurements:\r\n\r\nHeight: 6.3 in / 16 cm\r\nWidth: 8.7 in / 22 cm', 1),
('P00005', 'Tactibear Plush', 'Plush', 29.99, '6738bd2932708.png,6738bd293298c.png,6738bd2932c31.png', 89, NULL, NULL, NULL, 'From map easter egg to gunbuddy, Tactibear does it all. Add this cuddly Tactifriend in his iconic plush form factor to your collection today!\r\n\r\nApproximate Measurements:\r\n\r\nHeight: 8.1 in / 20.5 cm\r\nWidth: 8.1 in / 20.5 cm\r\nLength: 6.7 in / 17cm', 1),
('P00006', 'Sugarcone Furyhorn Plush', 'Plush', 27.50, '6738bd5229eb4.png,6738bd522a019.png,6738bd522a1dc.png', 99, NULL, NULL, NULL, 'Nothing is sweeter than combining sugarcones with a small, angry, horned beast.\r\n\r\nOptimized for skippability\r\nEnchanted red button\r\nHeight: 7.8 in / 19.8 cm\r\nWidth: 4.8 in / 12.2 cm\r\nDepth: 5.0 in / 12.7 cm\r\nPolyester Fiber', 1),
('P00007', 'Star Guardian Fuwa Plush', 'Plush', 35.00, '6738bd818f806.png,6738bd818fb47.png,6738bd818fe01.png', 99, NULL, NULL, NULL, 'When this bashful Little Legend feels lonely, Fuwa wraps itself in the warmth of its fuzzy ears - but don&#39;t worry, there&#39;s room for two!\r\n\r\nPerpetually on the hunt for the Star Guardian it&#39;s destined for, Fuwa takes on a new cuddly form because what Star Guardian could resist picking up this adorable plushy pig?', 1),
('P00008', 'Renektoy Plush', 'Plush', 34.99, '6738bdaab3012.png,6738bdaab3197.png,6738bdaab330c.png,6738bdaab345a.png', 99, NULL, NULL, NULL, 'Feeling a little rough around the edges? Let Renektoy take a chomp at it!\r\n\r\nRenektoy never backs down from a challenge - except for when their plush sword breaks... But fear not, with your help, you can patch it up and embark on endless adventures together, slicing through obstacles with joy and determination!\r\n\r\nDon&#39;t keep Renektoy on the sidelines; bring this cuddly champion home and let the fun begin!', 1),
('P00009', 'Renekton Plush', 'Plush', 29.99, '6738bdcd74371.png,6738bdcd745ec.png,6738bdcd74717.png', 99, NULL, NULL, NULL, 'This Renekton plush is filled with mindless, terror-inducing rage, but maybe he just needs a hug?\r\n\r\nApproximate Measurements\r\n\r\nWidth: 7.9 in / 20.0 cm\r\nHeight: 9.9 in / 25.0 cm\r\nDepth: 11.5 in / 29.0 cm', 1),
('P00010', 'Power Chord Ao Shin Plush', 'Plush', 34.99, '6738bdeaef852.png,6738bdeaefb37.png,6738bdeaefe05.png,6738bdeaf00d7.png', 100, NULL, NULL, NULL, 'Descended from Storm Dragon lineage as a guardian of the storm, Ao Shin doesn&#39;t always get a chance to escape responsibilities and rock out.\r\n\r\nHowever, when a battle of the bands comes around, Ao Shin drops the deity duties, puts on his rock outfit and sunglasses, and transforms into a guardian of the shred as Power Chord Ao Shin!\r\n\r\nPick up an Power Chord Ao Shin Plush and bring down the house with this Little Legend!', 1),
('P00011', 'Panda Choncc Plush', 'Plush', 29.99, '6738be0a02548.png,6738be0a02921.png,6738be0a02baa.png,6738be0a02e81.png', 100, NULL, NULL, NULL, 'With a backpack full of firecrackers (and a stomach full of dumplings), Panda Choncc is here and ready to take on whatever the new year has in store for you! Bring Chibi Panda Annie&#39;s finisher to life, defend against monsters, and add some lunar cheer to your TFT Little Legend collection with our Panda Choncc Plush today!', 1),
('P00012', 'K/DA ALL OUT Tibbers Plush', 'Plush', 35.00, '6738be38a9e89.png,6738be38a9fee.png,6738be38aa1b3.png,6738be38aa375.png', 99, NULL, NULL, NULL, 'K/DA&#39;s #1 stan.\r\n\r\nDetails:\r\n\r\nK/DA ALL OUT inspired Tibbers hoodie\r\nHeight: 16.0 in / 40.7 cm\r\nWidth: 10.0 in / 25.4 cm\r\nDepth: 5.0 in / 12.7 cm', 1),
('P00013', 'Gromp Plush', 'Plush', 29.99, '6738be5d12448.png,6738be5d126c9.png,6738be5d1297f.png,6738be5d12adf.png', 99, NULL, NULL, NULL, 'Vital source of jungle experience or floofy frog friend? Why not both? Grapple with these difficult questions no longer with our Gromp Plush!\r\n\r\nUnlike its Summoner Rift counterpart, our Gromp Plush&#39;s cuddly form factor lets you take it outside of its red and blue side nook to places no jungle monster has ever ventured before. Add our not so tiny toad to your collection today!', 1),
('P00014', 'Featherknight Plush', 'Plush', 27.50, '6738be7c49ed4.png,6738be7c4a318.png,6738be7c4a5af.png,6738be7c4a746.png', 100, NULL, NULL, NULL, 'The legendary Featherknight enters the fray, leading the rest of the Pengu into battle.\r\n\r\nApproxmiate Measurements:\r\n\r\nHeight: 7.8 in / 19.8 cm\r\nWidth: 4.8 in / 12.2 cm\r\nDepth: 5.0 in / 12.7 cm', 1),
('P00015', 'Elder Dragon Plush', 'Plush', 27.50, '6738beab07834.png,6738beab07a97.png,6738beab07dab.png', 100, NULL, NULL, NULL, 'The ruler of skies flies in as the softest dragon in Runeterra.\r\n\r\nApproxmiate Measurements:\r\n\r\nHeight: 7.8 in / 19.8 cm\r\nWidth: 4.8 in / 12.2 cm\r\nDepth: 5.0 in / 12.7 cm', 1),
('P00016', 'Corgi Corki Rose Quartz Chroma Plush', 'Plush', 34.99, '6738bed33bbfa.png,6738bed33be71.png,6738bed33c0bd.png,6738bed33c27f.png', 100, NULL, NULL, NULL, 'The Daring Bombardier rides again, this time in his special edition Rose Quartz chroma, ready to do battle with the nefarious cats!\r\n\r\n\r\nApproximate Measurements:\r\n\r\nHeight: 8.3 in / 12.0 cm\r\nWidth: 7.1 in / 18.0 cm\r\nDepth: 8.9 in / 22.5 cm', 1),
('P00017', 'Choncc Plush', 'Plush', 30.00, '6738beeea52b9.png,6738beeea5552.png,6738beeea57e4.png,6738beeea5a59.png', 99, NULL, NULL, NULL, 'Eternally hungry and perpetually sleepy, Choncc comes to life in adorable plush form! Now you can bring this snack-loving Little Legend with you on adventures beyond the Howling Abyss to explore the world outside of Runeterra. Choncc comes with his own little ricksack, replete with all the traveling necessities: a flag, a blanket, and of course a golden spatula. Don&#39;t leave Choncc hanging and bring this lovable Little Legend home today!', 1),
('P00018', 'Cafe Cuties Gwen Plush', 'Plush', 29.99, '6738bf0cb8491.png,6738bf0cb85dd.png,6738bf0cb86c9.png', 100, NULL, NULL, NULL, 'Originally a gift to Gwen from one of the daughter of one of her favorite patrons, our Cafe Cuties Gwen Plush is every inch as charming as the lively face of the cafe.\r\n\r\nPerfectly capturing Gwen&#39;s iconic, golden pastry-colored hair curls and the frills of her service outfit, our Cafe Cuties Gwen Plush lets patrons new and old bring some of the magic of the cafe with them, wherever they are.\r\n\r\nApproximate Dimensions:\r\n\r\nHeight: 25 cm / 9.9 in\r\nWidth: 22 cm / 7.9 in', 1),
('P00019', 'tokidoki x Arcane Desk Mat', 'Accessory', 31.99, '6738bf5660693.png,6738bf5660911.png,6738bf5660b04.png', 85, NULL, NULL, NULL, 'Blending the magic of Arcane with tokidoki&#39;s iconic kawaii look, play or work in style with the tokidoki x Arcane Desk Mat!\r\n\r\nDetails:\r\n\r\nDesk mat featuring Arcane characters!\r\nSize (approximate): 31 in x 8.5 in / 78.7 cm x 21.6 cm\r\nNon-slip base\r\nSuitable for a PC, laptop, keyboard, mouse, and/or accessories\r\nMat is made of Neoprene', 1),
('P00020', 'Worlds 2024 XL Mousepad', 'Accessory', 24.99, '6738bf9b100c1.png,6738bf9b10228.png,6738bf9b10384.png,6738bf9b104ed.png', 94, NULL, NULL, NULL, 'MAKE THEM BELIEVE\r\n\r\nWorlds is upon us. The pinnacle of LoL Esports has never just been a tournament. Teams and pros aren&#39;t here just to raise a trophy - they&#39;re here to make those feel something. They&#39;re here to make them believe.\r\n\r\nBelieve in the moment with the Worlds 2024 XL Mousepad.\r\n\r\nApproximate Dimensions:\r\n\r\nWidth: 31.3 in / 79.5 cm\r\nHeight: 11.8 in / 30 cm', 1),
('P00021', 'Viego Artisan Keycap', 'Accessory', 65.00, '6738bfc4878b5.png,6738bfc487b8b.png,6738bfc487d75.png,6738bfc487f2e.png', 88, NULL, NULL, NULL, 'The Black Mist pours freely from Viego&#39;s broken heart - ripping the life from everything it touches. Embrace it with this artisan keycap.\r\n\r\nFeatures:\r\n\r\nViego, the Ruined King inspired keycap\r\nHand painted and assembled\r\nTranslucent materials to let the RGB shine through\r\nMade from photopolymer resin\r\nCompatible with Cherry MX switches\r\nThis artisan keycap was created in collaboration with Clackeys and comes in premium League of Legends | Clackeys packaging.', 1),
('P00022', 'Tokidoki x Arcane Backpack', 'Accessory', 79.99, '6738c00466993.png,6738c00466aff.png,6738c00466bf6.png', 100, NULL, NULL, NULL, 'Blending the magic of Arcane with tokidoki&#39;s iconic kawaii look, pack your things in style with the tokidoki x Arcane Backpack!\r\n\r\nDetails:\r\n\r\nMeasurements (approximate): 15.5 in H x 11.5 in W x 5.5 in D / 39.4 cm H x 29.2 cm W x 14 cm D\r\nMaterial: 100% Polyester\r\nOutside: one zippered pocket on the front\r\nInside: One back panel sleeve\r\nAdjustable straps\r\nBlack lining\r\ntokidoki x ARCANE woven label on the front\r\nPrint placement will be random', 1),
('P00023', 'Spirit Blossom Ahri XL Mousepad', 'Accessory', 25.00, '6738c021cfd01.png,6738c021cfea2.png,6738c021cffd2.png,6738c021d00d6.png', 100, NULL, NULL, NULL, 'A capricious, charming guide to the spirit realm for lost mortals and souls alike, Spirit Blossom Ahri helps guide souls to their final rest and now, can guide your mouse too!\r\n\r\nFeatures:\r\n\r\nSpirit Blossom Ahri Champion Artwork\r\nCloth spandex print\r\nDouble-stitched, anti-fraying edges\r\nAnti-slip rubber base\r\nApproximate Measurements:\r\n\r\n31.0 x 11.5 in / 78.8 x 29.2 cm', 1),
('P00025', 'RockLove Crystal Rose Zyra Earrings', 'Accessory', 84.99, '6738c08e4dfc3.png,6738c08e4e436.png,6738c08e4e70c.png', 99, NULL, NULL, NULL, 'Born from a cutting of the Crystal Rose, Zyra wields her piercing thorns against any who seek to harm it.\r\n\r\nHandcrafted in solid sterling silver, the Crystal Rose Zyra Earrings feature symmetric post earrings in which cleverly curved vines weave behind and in front of the ear lobe, creating the illusion of multiple hoops. Accented by aurora borealis cubic zirconia crystals nestled amongst the sculpted thorns.\r\n\r\nFeatures:\r\n\r\nOfficial licensed League of Legends product\r\nNickel-free sterling silver, cubic zirconia crystal\r\n2 grams per earring\r\nApprox 15mm x 11mm\r\nThe League of Legends X RockLove jewelry collection arrives in a signature League of Legends X RockLove Collector&#39;s Box, with gold metallic silkscreened art inside and out: a compelling addition to any display case.\r\n\r\n©2023 Riot Games, Inc. League of Legends™ and Riot Games are trademarks, service marks or registered trademarks of Riot Games, Inc. All rights reserved.', 1),
('P00026', 'RockLove Crystal Rose Janna Staff Ring', 'Accessory', 84.99, '6738c0d484e1d.png,6738c0d484f7a.png,6738c0d48505f.png', 100, NULL, NULL, NULL, 'Born from the universal wish for peace, Janna is a spirit whose magic hangs like a wreath over the night. Though she’s regarded by most as a legend, guests sometimes say they see a beautiful woman float by. Or maybe it’s a trick of the crystal rose’s light…\r\n\r\nHandcrafted in solid sterling silver, the Janna Staff Ring features elegant, intertwined vines inspired by the staff wielded by the champion. Features a custom cut aurora borealis cubic zirconia crystal nestled amongst the sculpted thorns.\r\n\r\nFeatures:\r\n\r\nOfficial licensed League of Legends product\r\nNickel-free sterling silver, cubic zirconia crystal\r\n25mm x 14mm\r\nThe League of Legends X RockLove jewelry collection arrives in a signature League of Legends X RockLove Collector&#39;s Box, with gold metallic silkscreened art inside and out: a compelling addition to any display case.\r\n\r\n©2023 Riot Games, Inc. League of Legends™ and Riot Games are trademarks, service marks or registered trademarks of Riot Games, Inc. All rights reserved.', 1),
('P00027', 'RockLove Arcane Jinx Butterfly Ring', 'Accessory', 95.00, '6738c0f98fca2.png,6738c0f98fdfd.png,6738c0f9901fe.png', 100, NULL, NULL, NULL, 'Handcrafted in durable artisan brass and plated in polished 14K yellow gold, Jinx’s clockwork creation alights atop the finger with this wearable Butterfly Ring. Three-dimensional and faithfully accurate to those Jinx creates on-screen, the warm yellow gold is offset by hand-painted premium enamel in toxic green and magnetic and black. With cutout filigree and toothy skeletal grin, the statement ring is equal parts elegant and edgy. Available in US sizes 5 through 10.\r\n\r\nProduct Features:\r\n\r\nMetal: 14K yellow gold plated brass and enamel\r\nSizes: 5 - 6 - 7 - 8 - 9 - 10\r\nDimensions: 36mm x 28mm x 14mm\r\nThe League of Legends RockLove Boutique Box: The Jinx Butterfly Ring arrives in a signature League of Legends X RockLove Collector&#39;s Box, with gold metallic silkscreened art inside and out: a compelling addition to any display case.\r\n\r\n© 2022 Riot Games, Inc. League of Leegnds and Riot Games are trademarks, service marks, or registered trademarks of Riot Games, Inc. All rights reserved.', 1),
('P00028', 'Yi Keychain', 'Accessory', 12.00, '6738c118af534.png,6738c118af68b.png,6738c118af7c2.png', 100, NULL, NULL, NULL, 'Join the resistance and bring the power of PROJECT: Yi&#39;s experimental, hyperlight alpha blade wherever your adventures might take you with the PROJECT: Yi Keychain.\r\n\r\nApproximate Measurements:\r\n\r\nHeight: 2.7 in / 7 cm\r\nWidth: 0.8 in / 2 cm', 1),
('P00029', 'Little Legends Starmaw Mugs', 'Accessory', 18.00, '6738c139ca1ee.png,6738c139ca35c.png,6738c139ca49d.png', 100, NULL, NULL, NULL, 'Starmaw swims leisurely through the galaxies, oblivious to all other life around it. It&#39;s known as a devourer of worlds, but really it just happens to swallow a planet or two while it&#39;s yawning.\r\n\r\nProduct Details:\r\n\r\nHolds 11 oz\r\nHeight: 3.85 in / 9.80 cm\r\nWidth: 3.35 in / 8.50 cm\r\nCeramic\r\nWash thoroughly before first use\r\nMicrowave and dishwasher safe', 1),
('P00030', 'G-SHOCK x LoL Watch', 'Accessory', 1099.99, '6738c1559ec7b.png,6738c1559eeda.png,6738c1559f166.png,6738c1559f3bb.png', 99, NULL, NULL, NULL, '                            Introducing the GM2100LL-1A Hextech Watch - the first of two pieces in a first of its kind collaboration between CASIO G-SHOCK and League of Legends!\r\n\r\nBased on the GM-B2100, a full metal analog timepiece that evokes the original G-SHOCK DNA, the GM2100LL-1A is infused with Hextech magic, a core energy source and driving force in Runeterra.\r\n\r\nThe bezel and part of the band are initially finished in a gold ion plating followed by a worn layer of black to create a burnished look and feel.\r\n\r\nThe Piltover emblem is engraved onto one of the bands and blue LCD touches evoke the intersection of magic and technology that Hextech has come to represent.                        ', 1),
('P00031', 'G-SHOCK x LoL Jinx Watch', 'Accessory', 199.99, '6738c1794923e.png,6738c17949529.png,6738c17949816.png,6738c17949abf.png', 99, NULL, NULL, NULL, '                            Introducing the GA-110LL-1A Jinx Watch - the second of two pieces in a first of its kind collaboration between CASIO G-SHOCK and League of Legends!\r\n\r\nBased on the rugged GA-110 case, the GA-110LL-1A is boldly splashed with multiple layers of vivid pink, blue, and yellow. A crazy combination of colors only suitable for League&#39;s most excitable champion, Jinx.\r\n\r\nThe bezel and band details take inspiration from Jinx&#39;s Super Mega Death Rocket! ult and this motif spills over onto the speedometer dial and even the packaging.                        ', 1),
('P00032', 'I Hate Teemo Heat Reactive Mug', 'Accessory', 21.99, '6738c1c35fda2.png,6738c1c35ff0d.png,6738c1c360083.png,6738c1c360298.png', 100, NULL, NULL, NULL, 'Tired of trying to CS into ranged top lane abusers? Losing your mind from dying to mushrooms and blinding little Yordles? Sick of hearing the words &#34;the Scout&#39;s code&#34;? Well have we got the mug for you.\r\n\r\nOur I Hate Teemo Mug features everybody&#39;s least favorite Yordle just minding his own business planting deadly mushrooms. However, pour a hot drink in to reveal a hidden surprise from the brush and tell the world how you really feel.\r\n\r\nCeramic\r\nHand wash only\r\nDo not microwave\r\nWash thoroughly before first use', 1),
('P00033', 'Blood Moon Collectible Masks Set', 'Accessory', 49.99, '6738c1e2a635a.png,6738c1e2a649f.png,6738c1e2a6592.png,6738c1e2a670a.png', 100, NULL, NULL, NULL, 'Prepare for a Blood Moon rite with the Blood Moon Collectible Masks Set!\r\n\r\nThis trio of demonic masks comes with a display base as red as the Blood Moon itself, featuring Blood Moon iconography and a foldable backdrop showcasing the owners of the masks:\r\n\r\nBlood Moon Talon - The indiscriminate demon assassin\r\n\r\nBlood Moon Jhin - Blood Moon cult master of ceremonies\r\n\r\nBlood Moon Yasuo - Blood Moon cult ceremonial executioner\r\n\r\nMaterials:\r\n\r\nZinc Alloy Masks', 1),
('P00034', 'Infinity Studio Miss Fortune 3D Photo Frame', 'Accessory', 123.99, '6738c20a11e27.png,6738c20a11f7f.png,6738c20a12071.png,6738c20a1701e.png', 100, NULL, NULL, NULL, 'The bigger the risk, the bigger the bounty.&#34;\r\n\r\nA perfect gift for Miss Fortune&#39;s first mate (or your ADC friend), the Infinity Studio Miss Fortune 3D Photo Frame captures the infamous Bilgewater bounty hunter at her very best.\r\n\r\nDelicately molded to capture every detail of The Bounty Hunter from her family&#39;s heirloom pistol to the sun-belted waves of her hair, this frame adds some serious pirate power wherever its displayed.\r\n\r\nApproximate Measurements:\r\n\r\nHeight: 25 cm / 9.8 in\r\nWidth: 21 cm / 8.3 in\r\nDepth: 3 cm / 1.3 in\r\nMade in partnership with Infinity Studio.', 1),
('P00035', 'Worlds 2024 Baseball Hat', 'Apparel', 26.99, '6738c307f21bf.png,6738c307f245c.png,6738c307f26f8.png', NULL, 99, 95, 95, 'MAKE THEM BELIEVE\r\n\r\nWorlds is upon us. The pinnacle of LoL Esports has never just been a tournament. Teams and pros aren&#39;t here just to raise a trophy - they&#39;re here to make those feel something. They&#39;re here to make them believe.\r\n\r\nBelieve in the moment with the Worlds 2024 Baseball Hat.\r\n\r\nFeatures:\r\n\r\n100% cotton canvas\r\n\r\nVolume embroidered Worlds logo embellishments\r\n\r\nAdjustable velcro closure\r\n\r\nClassic 5 panel fit\r\n\r\nOne size fits most.', 1),
('P00036', 'VALORANT Reyna Tee', 'Apparel', 30.00, '6738c3959eac3.png,6738c3959ecb3.png,6738c3959ef3a.png,6738c3959f13d.png', NULL, NULL, NULL, NULL, 'Become one with the empress with this Agent tee featuring Reyna! Made of 100% cotton and resistant to soul orb stains, this tee lets laugh in the face of overwhelming odds. Secure the ace and look good while doing it.\r\n\r\nPrint Design\r\nScreenprinted design\r\n\r\nMaterials\r\n100% cotton', 1),
('P00037', 'VALORANT Iso Quarter Zip Detachable Jacket', 'Apparel', 119.99, '6738c3c685e97.png,6738c3c6860df.png,6738c3c686279.png', NULL, NULL, NULL, NULL, 'Step into the world of VALORANT with our Iso Quarter Zip Detachable Jacket. Designed for the needs of the modern agent, this jacket combines functionality, style, and versatility, perfect for those on and off the battlefield.\r\n\r\nFeatures:\r\n\r\n100% nylon construction\r\nRemovable sleeves\r\nHigh density patches\r\nElasticized waistband and sleeve hems\r\nWoven and rubber patch VALORANT trims', 1),
('P00038', 'VALORANT DTL Heavy Tee', 'Apparel', 40.00, '6738c3fe7b066.png,6738c3fe7b1bc.png,6738c3fe7b2aa.png,6738c3fe7b39f.png', NULL, 100, 100, 100, 'Put the team on your back in this DEFY THE LIMITS tee! Made of a heavier weight cotton, this tee is the perfect piece of kit to help you clutch out the ace and stay cozy all at the same time.\r\n\r\nPrint Design\r\nScreenprinted design\r\n\r\nMaterials\r\n100% cotton', 1),
('P00039', 'VALORANT Defy the Limits Zip Hoodie', 'Apparel', 94.99, '6738c42c14383.png,6738c42c14588.png,6738c42c1469e.jfif', NULL, 98, 98, 98, 'Bring it back to basics with the re-launch of the VALORANT &#34;Defy the Limits&#34; Zip Hoodie.\r\n\r\nFeatures:\r\n\r\n100% cotton\r\nOversize VALORANT patch on back\r\nCustom VALORANT rubber patch on left chest\r\nSoft hand plastisol screen print hits on sleeves\r\nFront pockets\r\nAs pictured: Female talent is 5&#39;8 wearing a size M. Male talent is 6&#39;3 wearing a size L.', 1),
('P00040', ' VALORANT Champions 2024', 'Apparel', 44.99, '6738c458edd22.png,6738c458edfb3.png,6738c458ee226.png', NULL, 100, 100, 100, 'This is the moment where everything intersects. Witness a SUPERNOVA in Seoul as players and teams across the world collide for the trophy and the championship!\r\n\r\nGet ready to watch the best of the best plant, defuse, and clutch it out in the VALORANT Champions 2024 Supernova Dry Fit Long Sleeve Tee.\r\n\r\nFeatures:\r\n\r\n95% polyester, 5% spandex construction\r\nReflective HD heat transfer Supernova graphic on front chest\r\nReflective cuff print\r\nFully sublimated gradient\r\nVALORANT Champions graphic on back', 1),
('P00041', 'VALORANT Champions 2024', 'Apparel', 74.99, '6738c47f81a2f.png,6738c47f81c7c.png,6738c47f81ec6.png', NULL, 100, 100, 100, 'This is the moment where everything intersects. Witness a SUPERNOVA in Seoul as players and teams across the world collide for the trophy and the championship!\r\n\r\nGet ready to watch the best of the best plant, defuse, and clutch it out in the VALORANT Champions 2024 Supernova Packable Anorak.\r\n\r\nFeatures:\r\n\r\n100% nylon construction\r\nReflective HD heat transfer VALORANT Champions graphic on sleeves\r\nReflective piping\r\nElastic bungee at hem\r\nHood packs into collar\r\nFront center pocket with velcro closure', 1),
('P00042', 'VALORANT Bind Full Zip Hoodie', 'Apparel', 69.99, '6738c4bf3fdc1.png,6738c4bf40057.png,6738c4bf402b2.png,6738c4bf404dd.png', NULL, 100, 100, 100, 'Whether you&#39;re pushing up B Long or camping out in heaven waiting for someone to finish their bath, pay tribute to one of the OG maps with the VALORANT Bind Full Zip Hoodie.\r\n\r\nFeatures:\r\n\r\n280 gsm 100% cotton zip up hoodie\r\nCustom Bind map patch appliques\r\nSofthand screen printing on front and back\r\nVALORANT rubber patch on back\r\nWoven VALORANT clip label', 1),
('P00043', 'VALORANT Basketball Shorts', 'Apparel', 50.00, '6738c4d56ca7e.png,6738c4d56cc31.png,6738c4d56cf97.png', NULL, 100, 100, 100, 'These VALORANT basketball shorts are perfect for everything from lineups to layups and anything in between. These shorts feature heavy duty drawstrings for a comfortable fit for most sizes, a rubber VALORANT logo label, and patterened pocket inserts!', 1),
('P00045', 'TFT Featherknight White Tee (Unisex)', 'Apparel', 30.00, '6738c5e688bbc.png,6738c5e68905e.png,6738c5e689278.png,6738c5e6893d6.png', NULL, NULL, NULL, NULL, 'Take on all comers, no matter what comp they might be playing, with our Teamfight Tactics Featherknight tee in white. Let this iconic Little Legend guide your high (or low) rolls to tactical victory. Made of 100% cotton, machine-washable, and Pengu-approved, this comfortable tee will stand the test of time from patch to patch and set to set.\r\n\r\nCare Instructions:\r\n\r\nMachine wash cold with like colors\r\nOnly non-chlorine bleach when needed\r\nTumble dry low\r\nDo not iron\r\nDo not dry clean\r\n\r\nPrint Design\r\nScreenprinted design\r\n\r\nMaterials\r\n100% Cotton', 1),
('P00046', 'Sentinel of Light Lucian Tee', 'Apparel', 30.00, '6738c63ba25a8.png,6738c63ba2714.png,6738c63ba283b.png,6738c63ba2a4e.png', NULL, 95, 95, 95, 'Cleanse shadow from the world with the Sentinel of Light Lucian tee! Featuring Lucian wielding his iconic relic pistols on the back and a Sentinel icon on the front, this tee is ready for whatever the Black Mist may bring.\r\n\r\nPrint Design\r\nScreenprinted Design\r\n\r\nMaterials\r\n100% Cotton', 1),
('P00047', 'Master Chef Tahm Kench Tee', 'Apparel', 29.99, '6738c6580c150.png,6738c6580c2ab.png,6738c6580c3f3.png', NULL, 100, 100, 100, 'Refuse to succumb to culinary degradation with this Master Chef Tahm Kench tee! Featuring a graphic of the River King applying his fearsome culinary technique on the back, this tee reminds everybody that mercy has no flavor.\r\n\r\nFeatures:\r\n\r\n100% cotton\r\nScreenprinted graphics', 1),
('P00048', 'League of Legends Premium Hoodie (Women&#39;s)', 'Apparel', 65.00, '6738c67ce362d.png,6738c67ce3924.png', NULL, 100, 100, 100, 'This gold foil League of Legends hoodie won&#39;t grant +45 magic resistance , but it&#39;ll definitely keep you warm and in style (it also doesn&#39;t cost 750 gold).', 1),
('P00049', 'Blood Moon Masks Tee', 'Apparel', 29.99, '6738c69a72e12.png,6738c69a72f6f.png,6738c69a73094.png,6738c69a731b2.png', NULL, 100, 100, 100, 'Call forth the power of the Blood Moon Jhin, Yasuo, and Talon in the Blood Moon Masks Tee.\r\n\r\nFully certified for a wide range of activities from demonic possession rituals to work-from-home video calls, our Blood Moon Masks Tee is made of 100% cotton for cult-like comfort.', 1),
('P00050', 'Arcane Caitlyn & Vi Short Sleeve Tee', 'Apparel', 29.99, '6738c6bec3bc8.png,6738c6bec3d0c.png,6738c6bec3e3c.png', NULL, 100, 100, 100, 'Whether you stand with Zaun and the undercity, push for progress in Piltover, or just want to watch it all burn, the new Arcane merch collection has something for every fan.\r\n\r\nFor all the CaitVi shippers and those of you who like to punch first and get cupcakes later, catch the final season in comfort with the Arcane Caitlyn & Vi Short Sleeve Tee!\r\n\r\nFeatures:\r\n\r\nCustom 20/1&#39;s 100% cotton\r\nGarment pigment dyed\r\nSofthand plastisol screenprinted Caitlyn and Vi graphic', 1),
('P00051', ' VALORANT Champions 2024', 'Apparel', 84.99, '6738c6e45a9d0.png,6738c6e45abd9.png,6738c6e45ad6c.png', NULL, NULL, 99, NULL, 'This is the moment where everything intersects. Witness a SUPERNOVA in Seoul as players and teams across the world collide for the trophy and the championship!\r\n\r\nGet ready to watch the best of the best plant, defuse, and clutch it out in the VALORANT Champions 2024 edition of the Alpha Tech Hoodie.\r\n\r\nFeatures:\r\n\r\n100% cotton french terry\r\n570 gsm\r\nGold 3M piping\r\nKangaroo pocket\r\nCenter front rubber patch VCT spark emblem', 1),
('P00052', 'Worlds 2023 T1 Ahri Fox Plush', 'Plush', 34.99, '6738ef42ea9f4.png,6738ef42eab7e.png,6738ef42eac7b.png', 100, 95, 95, 95, 'Celebrate T1, the winners of Worlds 2023, with this limited edition Ahri Fox Plush!\r\n\r\nThis little fox comes in an exclusive red, black, and gold T1 colorway with an embroidered T1 logo scarf and gold bell, complete with a matching cinched packing bag\r\n\r\nWith only limited quantities available, don&#39;t miss your chance to commemorate all the hype from T1&#39;s win with the Worlds 2023 T1 Ahri Fox Plush.', 1),
('P00053', 'VALORANT Killjoy Long Sleeve Tee', 'Apparel', 49.99, '6738f0dae6329.png,6738f0dae64c7.png,6738f0dae65e7.png', NULL, NULL, NULL, NULL, 'Bring it back to basics with the re-launch of the VALORANT Killjoy Long Sleeve Tee.\r\n\r\nFeatures:\r\n\r\n100% 20/1 cotton long sleeve with sleeve cuffs\r\nSoft hand plastisol VALORANT graphic screenprint\r\nAs pictured: Female talent is 5&#39;8 wearing a size M. Male talent is 6&#39;3 wearing a size L.', 1),
('P00054', 'Prison Realm3', 'Accessory', 6969.69, '6738f297cb9f6.png,6738f297cbc44.png,6738f297cbdf4.png', 99, NULL, NULL, NULL, '                                                                                                                                                                                                                                                                                                                                                                                                        The Prison Realm in Jujutsu Kaisen is an incredibly powerful and unyielding domain, designed to trap and isolate even the most formidable of beings. Its strength is unmatched, making it virtually impossible to escape once imprisoned within. Even &#34;The Strongest&#34; cannot break free from its grasp, as the Prison Realm’s intricate design and overwhelming power ensure that no matter how great the individual’s abilities, they are helpless against its confinement. It stands as one of the most formidable barriers in the series, a true testament to its extraordinary potency.                                                                                                                                                                                                                                                                                                                                                ', 1);

